import React from 'react';
import s from './MyPosts.module.css';
import Post from './Post/Post';

const MyPosts = (props) => {

    let postData = [
        {id: 1, massage: "Hi, How are you", like: 15},
        {id: 2, massage: "Hi, it's my first post", like: 10},

    ]

    return (
        <div className={s.postBlock}>
            <h3> My post </h3>
            <div>
                <div>
                    <textarea/>
                </div>
                <div>
                    <button>Add post</button>
                    <button>Remove</button>
                </div>
            </div>
            <div className={s.posts}>
                <Post message={postData[0].ms} like="15"/>
                <Post message="Hi, it's my first post" like="10"/>
            </div>
        </div>
    )
}

export default MyPosts;
